<p>Por exemplo, se você alterar a tradução da chave <strong>"menu.search"</strong> de "Pesquisa" para "Busca" pelo módulo de traduções multi-bibliotecas, todas as bibliotecas deste grupo verão a nova tradução. Porém, se um dos administradores de uma destas bibliotecas alterar, através do módulo de <strong>"Traduções"</strong> de sua biblioteca, a mesma chave para "Procurar", esta tradução interna terá prioridade, apenas para esta biblioteca.</p>
<p>Para adicionar um novo idioma, baixe o arquivo de idioma em Português, faça a tradução dos textos e depois faça o envio do arquivo. Lembre-se que apenas os <strong>textos</strong> (depois do sinal de igual) devem ser alterados.  Não altere as chaves, ou o Biblivre 4 não conseguirá localizar o texto</p>
<p>Exemplo: digamos que você queira alterar o texto no menu principal de <i>Pesquisa</i> para <i>Busca</i>.  Você deverá então baixar o arquivo do idioma e alterar a seguinte linha:</p>
<p><strong>*menu.search</strong> = Pesquisa</p>
<p>Para:</p>
<p><strong>*menu.search</strong> = Busca</p>
<p>E então fazer o Envio do arquivo de idiomas. O Biblivre 4 irá processar o arquivo, e alterar o texto do menu.</p>', '2014-06-21 11:54:49.572182', 1, '2014-06-21 11:54:49.572182', 1, false);
<p><strong>Atención:</strong> Este Informe puede llevar algunos minutos para ser generado, dependiendo del tamaño de la base bibliográfica.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p><strong>Atención: Este módulo realiza configuraciones avanzadas del Biblivre 4, y debe ser utilizado solamente por Usuarios avanzados, con experiencia en informática.</strong>.</p>
<p>Para agregar un nuevo idioma, baje el archivo de idioma en portugués, haga la traducción de los textos y después envíe el archivo. Recuerde que solamente los <strong>textos</strong> (después del signo igual) deben ser alterados.  No altere las llaves, caso contrario el Biblivre 4 no conseguirá localizar el texto</p>
<p>Ejemplo: digamos que usted quiera alterar el texto en el menú principal de <i>Búsqueda</i> para <i>Buscar</i>.  Usted deberá entonces bajar el archivo del idioma y alterar la siguiente línea:</p>
<p><strong>*menu.search</strong> = Búsqueda</p>
<p>Para:</p>
<p><strong>*menu.search</strong> = Busca</p>
<p>Y entonces hacer el envío del archivo de idiomas. El Biblivre 4 procesará el archivo, y alterará el texto del menú.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>La búsqueda tratará de encontrar los Usuarios ya registrados en el Biblivre, y funciona de la misma manera que la búsqueda simplificada de la rutina de Registro de Usuarios.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>En el momento de la salida del lector, usted podrá desvincular la tarjeta procurando por el código del mismo</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>Para realizar una búsqueda, rellene los términos de la búsqueda, seleccionando el campo de interés. En seguida, seleccione una o más bibliotecas donde se deberán localizar los registros. <span class="warn">Atención: seleccione pocas bibliotecas para evitar que la búsqueda distribuida sea muy lenta, entendiendo que ella depende de la comunicación entre las bibliotecas y el tamaño de cada acervo.</span></p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>Los cancelamientos pueden hacerse seleccionando el lector que posee la reserva.</p><p>La duración de la reserva se calcula de acuerdo con el tipo de usuario, configurado por el menú <strong>Administración</strong> y definido durante el registro del lector.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>Es posible Generar las etiquetas de uno o más ejemplares en una única impresión, utilizando la búsqueda abajo. Este atento al detalle de que el resultado de esta búsqueda es una lista de ejemplares y no de registros bibliográficos.</p>
<p>Luego de encontrar el(los) ejemplar(es) de interés, use el botón <strong>"Seleccionar ejemplar"</strong> para agregarlos a la lista de impresión de etiquetas. Usted podrá hacer diversas búsquedas, sin perder la selección hecha anteriormente. Cuando finalmente este satisfecho con la selección, cliquee en el botón <strong>"Imprimir etiquetas"</strong>. Será posible seleccionar cual modelo de la hoja de etiquetas se utilizará y en qué posición iniciar.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>La forma más simple es usar la <strong>búsqueda simplificada</strong>, que tratará de encontrar cada uno de los términos digitados en los siguientes campos: <em>{0}</em>.</p>
<p>Las palabras son buscadas en su forma completa, pero es posible usar el caracter asterisco (*) para buscar por palabras incompletas, de modo que la búsqueda <em>''brasil*''</em> encuentre registros que contengan <em>''brasil''</em>, <em>''brasilia''</em> y <em>''brasilero''</em>, por ejemplo. Los pares de comillas pueden ser usados para encontrar dos palabras en secuencia, de modo que la búsqueda <em>"mi amor"</em> encuentre registros que contengan las dos palabras juntas, pero no encuentre registros con el texto <em>''mi primer amor''</em>.</p>
<p>La <strong>búsqueda avanzada</strong> otorga un mayor control sobre los registros localizados, permitiendo, por ejemplo, buscar por fecha de catalogación o exactamente en el campo deseado.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>La búsqueda tratará de encontrar cada uno de los términos digitados en los siguientes campos: <em>{0}</em>.</p>
<p>Las palabras son buscadas en su forma completa, pero es posible usar el carácter asterisco (*) para buscar por palabras incompletas, de modo que la búsqueda <em>''brasil*''</em> encuentre registros que contengan <em>''brasil''</em>, <em>''brasilia''</em> y <em>''brasilero''</em>, por ejemplo. Los pares de comillas pueden ser usados para encontrar dos palabras en secuencia, de modo que la búsqueda <em>"mi amor"</em> encuentre registros que contengan las dos palabras juntas, pero no encuentre registros con el texto <em>''mi primer amor''</em>.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>La búsqueda tratará de encontrar cada uno de los términos digitados en los campos <em>Número de Registro de Pedido, Nombre de Fantasía del Proveedor, y Autor o Título de la Solicitud</em>.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>Es posible generar los carnets de uno o más lectores en una única impresión, utilizando la búsqueda abajo.</p>
<p>Luego de encontrar el(los) lector(es), use el botón <strong>"Seleccionar usuario"</strong> para agregarlos a la lista de impresión de carnets. Usted podrá realizar diversas búsquedas, sin perder la selección hecha anteriormente. Cuando este satisfecho con la selección, cliquee en el botón <strong>"Imprimir carnets"</strong>. Será posible seleccionar la posición del primer carnet en la hoja de etiquetas.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>La búsqueda tratará de encontrar cada uno de los términos digitados en los campos <em>Número de Registro de Cotización o Nombre Fantasía del Proveedor</em>.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>Sea bienvenido a la <strong>Biblioteca Libre (Biblivre) versión 4.0</strong>.</p>
<p>Usted podrá hacer búsquedas por registros bibliográficos, autoridades y vocabulario con la opción <em>"Búsqueda"</em> en el menú superior. Esta es la misma <em>"Búsqueda"</em> que los lectores podrán usar al accesar al <strong>Biblivre</strong>, sin necesidad de usuario y contraseña, para buscar por registros en la Base Principal.</p>
<p>Para registrar lectores, realizar préstamos, devoluciones y reservas, controlar el acceso a la biblioteca e imprimir carnets, use la opción <em>"Circulación"</em>, también en el menú superior.</p>
<p>En la opción <em>"Catalogación"</em>, usted podrá controlar el acervo de la biblioteca, catalogando obras y ejemplares, y efectuar el control de autoridades y de vocabulario. A través de esta opción también es posible imprimir las etiquetas usadas en los ejemplares, mover registros entre las bases de datos (Principal, Trabajo, Privada y Papelera de reciclaje), importar y exportar registros y agregar archivos digitales a los registros existentes.</p>
<p>El <strong>Biblivre</strong> también posee un sistema simple de control del proceso de adquisición, para auxiliar la compra y recibimiento de publicaciones, a través de la opción <em>"Adquisición"</em>.</p>
<p>En <em>"Administración"</em>, usted podrá cambiar la contraseña de acceso, configurar recursos del <strong>Biblivre</strong> como campos de los formularios, traducciones y tipos de usuario, registrar tarjetas de acceso, generar informes y realizar la manutención de la base de datos, que incluye la generación de la copia de seguridad (backup), y la Reindización de la base de datos, que debe ser usada cuando algunos registros no pueden ser encontrados a través de la búsqueda.</p>
<p>En caso que precise de más informaciones sobre el <strong>Biblivre</strong>, accese a la opción <em>"Ayuda"</em> y lea el Manual del programa o las preguntas frecuentes, en <a href="http://biblivre.org.br/forum" target="_blank">Fórum</a>.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>Algunos de los Informes disponibles poseen filtros, como Base Bibliográfica, o Período, por ejemplo. Para otros, basta seleccionar el Informe y cliquear en "Emitir Informe".</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>Se trata de un programa para catalogación y difusión de acervos de bibliotecas públicas y privadas, de variados portes, además de posibilitar la circulación y el compartir contenidos de información, tales como, textos, músicas, imágenes y películas o cualquier otro tipo de objeto digital.</p>
<p>Hoy, el <strong>Biblivre</strong> es un éxito en todo Brasil, así como en el exterior y, por su extrema relevancia cultural, se viene asentando como el aplicativo de elección para la inclusión digital del ciudadano.</p>
<p>Si desea solamente buscar el catálogo y accesar a las obras disponibles digitalmente, utilize la opción <em>"Búsqueda"</em> en el menú superior, sin la necesidad de usuario y contraseña.</p>
<p>Para otros servicios, tales como circulación, catalogación, adquisición y administración, es necesario un nombre de <strong>usuario</strong> y <strong>contraseña</strong>.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>Al accesar a esa rutina, el Biblivre listará automáticamente todos los Servidores previamente registrados. Usted podrá entonces filtrar esa lista, digitando el <em>Nombre</em> de un Servidor que quiera encontrar.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>La búsqueda tratará de encontrar cada uno de los términos digitados en los siguientes campos: <em>{0}</em>.</p>
<p>Las palabras son buscadas en su forma completa, pero es posible usar el caracter asterisco (*) para buscar por palabras incompletas, de modo que la búsqueda <em>''brasil*''</em> encuentre registros que contengan <em>''brasil''</em>, <em>''brasilia''</em> y <em>''brasilero''</em>, por ejemplo. Los pares de comillas pueden ser usados para encontrar dos palabras en secuencia, de modo que la búsqueda <em>"mi amor"</em> encuentre registros que contengan las dos palabras juntas, pero no encuentre registros con el texto <em>''mi primer amor''</em>.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<ul><li>Registrar Nueva Tarjeta: utilice para registrar solo una tarjeta de acceso;</li><li>Registrar Secuencia de Tarjetas: utilice para registrar más de una tarjeta de acceso, en secuencia. Utilize el campo "Previsualización" para verificar como serán las numeraciones de las tarjetas incluidas.</li></ul>
<p>Al accesar a esa rutina, el Biblivre alistará automáticamente todos las Tarjetas de Acceso previamente registradas.  Usted podrá entonces filtrar esa lista, digitando el <em>Código</em> de una Tarjeta de Acceso que quiera encontrar.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>La búsqueda tratará de encontrar cada uno de los términos digitados en los campos <em>Solicitante, Autor o Título</em>.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>Por ejemplo, si usted altera la traducción de la llave <strong>"menu.search"</strong> de "Búsqueda" para "Busca" por el módulo de traducciones multibibliotecas, todas las bibliotecas de este grupo verán la nueva traducción. Sin embargo, si uno de los administradores de una de estas bibliotecas alterara, a través del módulo de <strong>"Traducciones"</strong> de su biblioteca, la misma llave para "Procurar", esta traducción interna tendrá prioridad, solamente para esta biblioteca.</p>
<p>Para agregar un nuevo idioma, baje el archivo de idioma en Portugués, realice la traducción de los textos y después envíe el archivo. Recuerde que solamente los <strong>textos</strong> (después del signo igual) deben ser alterados.  No altere las llaves, o el Biblivre 4 no conseguirá localizar el texto</p>
<p>Ejemplo: digamos que usted quiera alterar el texto en el menú principal de <i>Búsqueda</i> para <i>Busca</i>.  Usted deberá entonces bajar el archivo de idioma y alterar la siguiente línea:</p>
<p><strong>*menu.search</strong> = Búsqueda</p>
<p>Para:</p>
<p><strong>*menu.search</strong> = Busca</p>
<p>Y entonces hacer el Envío de archivo de idiomas. El Biblivre 4 procesará el archivo, y alterará el texto del menú.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p><strong>Atenção: Este módulo realiza configurações avançadas do Biblivre 4, e deve ser utilizado apenas por Usuários avançados, com experiência em informática.</strong>.</p>
<p>Para adicionar um novo idioma, baixe o arquivo de idioma em Português, faça a tradução dos textos e depois faça o envio do arquivo. Lembre-se que apenas os <strong>textos</strong> (depois do sinal de igual) devem ser alterados.  Não altere as chaves, ou o Biblivre 4 não conseguirá localizar o texto</p>
<p>Exemplo: digamos que você queira alterar o texto no menu principal de <i>Pesquisa</i> para <i>Busca</i>.  Você deverá então baixar o arquivo do idioma e alterar a seguinte linha:</p>
<p><strong>*menu.search</strong> = Pesquisa</p>
<p>Para:</p>
<p><strong>*menu.search</strong> = Busca</p>
<p>E então fazer o Envio do arquivo de idiomas. O Biblivre 4 irá processar o arquivo, e alterar o texto do menu.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>A pesquisa buscará os usuários já cadastrados no Biblivre, e funciona da mesma forma que a pesquisa simplificada da rotina de Cadastro de Usuários.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>No momento da saída do leitor, você poderá desvincular o cartão procurando pelo código do mesmo</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>Para realizar uma pesquisa, preencha os termos da pesquisa, selecionando o campo de interesse. Em seguida, selecione uma ou mais bibliotecas onde os registros deverão ser localizados. <span class="warn">Atenção: selecione poucas bibliotecas para evitar que a busca distribuída fique muito lenta, visto que ela depende da comunicação entre as bibliotecas e o tamanho de cada acervo.</span></p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>Cancelamentos podem ser feitos selecionando o leitor que possui a reserva.</p><p>A duração da reserva é calculada de acordo com o tipo de usuário, configurado pelo menu <strong>Administração</strong> e definido durante o cadastro do leitor.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>É possível gerar as etiquetas de um ou mais exemplares em uma única impressão, utilizando a pesquisa abaixo. Fique atento ao detalhe de que o resultado desta pesquisa é uma lista de exemplares e não de registros bibliográficos.</p>
<p>Após encontrar o(s) exemplare(s) de interesse, use o botão <strong>"Selecionar exemplar"</strong> para adicioná-los à lista de impressão de etiquetas. Você poderá fazer diversas pesquisas, sem perder a seleção feita anteriormente. Quando finalmente estiver satisfeito com a seleção, clique no botão <strong>"Imprimir etiquetas"</strong>. Será possível selecionar qual modelo da folha de etiquetas a ser usado e de qual posição iniciar.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>A forma mais simples é usar a <strong>pesquisa simplificada</strong>, que buscará cada um dos termos digitados nos seguintes campos: <em>{0}</em>.</p>
<p>As palavras são pesquisadas em sua forma completa, porém é possível usar o caractere asterisco (*) para buscar por palavras incompletas, de modo que a pesquisa <em>''brasil*''</em> encontre registros que contenham <em>''brasil''</em>, <em>''brasilia''</em> e <em>''brasileiro''</em>, por exemplo. Aspas duplas podem ser usadas para encontrar duas palavras em sequência, de modo que a pesquisa <em>"meu amor"</em> encontre registros que contenham as duas palavras juntas, mas não encontre registros com o texto <em>''meu primeiro amor''</em>.</p>
<p>A <strong>pesquisa avançada</strong> confere um maior controle sobre os registros localizados, permitindo, por exemplo, buscar por data de catalogação ou exatamente no campo desejado.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>A pesquisa buscará cada um dos termos digitados nos seguintes campos: <em>{0}</em>.</p>
<p>As palavras são pesquisadas em sua forma completa, porém é possível usar o caractere asterisco (*) para buscar por palavras incompletas, de modo que a pesquisa <em>''brasil*''</em> encontre registros que contenham <em>''brasil''</em>, <em>''brasilia''</em> e <em>''brasileiro''</em>, por exemplo. Aspas duplas podem ser usadas para encontrar duas palavras em sequência, de modo que a pesquisa <em>"meu amor"</em> encontre registros que contenham as duas palavras juntas, mas não encontre registros com o texto <em>''meu primeiro amor''</em>.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>A pesquisa buscará cada um dos termos digitados nos campos <em>Número do Registro do Pedido, Nome Fantasia do Fornecedor, e Autor ou Título da Requisição</em>.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>É possível gerar as carteirinhas de um ou mais leitores em uma única impressão, utilizando a pesquisa abaixo.</p>
<p>Após encontrar o(s) leitor(es), use o botão <strong>"Selecionar usuário"</strong> para adicioná-los à lista de impressão de carteirinhas. Você poderá fazer diversas pesquisas, sem perder a seleção feita anteriormente. Quando estiver satisfeito com a seleção, clique no botão <strong>"Imprimir carteirinhas"</strong>. Será possível selecionar a posição da primeira carteirinha na folha de etiquetas.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>A pesquisa buscará cada um dos termos digitados nos campos <em>Número do Registro de Cotação ou Nome Fantasia do Fornecedor</em>.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>Seja bem-vindo ao <strong>Biblioteca Livre (Biblivre) versão 4.0</strong>.</p>
<p>Você poderá fazer pesquisas por registros bibliográficos, autoridades e vocabulário pela opção <em>"Pesquisa"</em> no menu superior. Esta é a mesma <em>"Pesquisa"</em> que os leitores poderão usar ao acessar o <strong>Biblivre</strong>, sem necessidade de usuário e senha, para pesquisar por registros na Base Principal.</p>
<p>Para cadastrar leitores, realizar empréstimos, devoluções e reservas, controlar o acesso à biblioteca e imprimir carteirinhas, use a opção <em>"Circulação"</em>, também no menu superior.</p>
<p>Na opção <em>"Catalogação"</em>, você poderá controlar o acervo da biblioteca, catalogando obras e exemplares, e efetuar o controle de autoridades e do vocabulário. Através desta opção tambem é possível imprimir as etiquetas usadas nos exemplares, mover registros entre as bases de dados (Principal, Trabalho, Privada e Lixeira), importar e exportar registros e adicionar arquivos digitais aos registros existentes.</p>
<p>O <strong>Biblivre</strong> também possui um sistema simples de controle do processo de aquisição, para auxiliar a compra e recebimento de publicações, através da opção <em>"Aquisição"</em>.</p>
<p>Em <em>"Administração"</em>, você poderá trocar a senha de acesso, configurar recursos do <strong>Biblivre</strong> como campos dos formulários, traduções e tipos de usuário, cadastrar cartões de acesso, gerar relatórios e realizar a manutenção da base de dados, que inclui a geração da cópia de segurança (backup), e a reindexação da base de dados, que deve ser usada quando alguns registros não puderem ser encontrados através da pesquisa.</p>
<p>Caso precise de mais informações sobre o <strong>Biblivre</strong>, acesse a opção <em>"Ajuda"</em> e leia o Manual do programa ou as perguntas frequentes, no <a href="http://biblivre.org.br/forum" target="_blank">Fórum</a>.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>Alguns dos relatórios disponíveis possuem filtros, como Base Bibliográfica, ou Período, por exemplo. Para outros, basta selecionar o relatório e clicar em "Emitir Relatório".</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>Trata-se de um programa para catalogação e difusão de acervos de bibliotecas públicas e privadas, de variados portes, além de possibilitar a circulação e o compartilhamento de conteúdos de informação, tais como, textos, músicas, imagens e filmes ou qualquer outro tipo de objeto digital.</p>
<p>Hoje, o <strong>Biblivre</strong> é sucesso em todo o Brasil, assim como no exterior e, por sua extrema relevância cultural, vem se firmando como o aplicativo de escolha para a inclusão digital do cidadão.</p>
<p>Se desejar somente pesquisar o catálogo e acessar as obras disponíveis digitalmente, utilize a opção <em>"Pesquisa"</em> no menu superior, sem a necessidade de usuário e senha.</p>
<p>Para outros serviços, tais como circulação, catalogação, aquisição e administração, é necessário um nome de <strong>usuário</strong> e <strong>senha</strong>.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>Ao acessar essa rotina, o Biblivre listará automaticamente todos os Servidores previamente cadastrados.  Você poderá então filtrar essa lista, digitando o <em>Nome</em> de um Servidor que queira encontrar.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>A pesquisa buscará cada um dos termos digitados nos seguintes campos: <em>{0}</em>.</p>
<p>As palavras são pesquisadas em sua forma completa, porém é possível usar o caractere asterisco (*) para buscar por palavras incompletas, de modo que a pesquisa <em>''brasil*''</em> encontre registros que contenham <em>''brasil''</em>, <em>''brasilia''</em> e <em>''brasileiro''</em>, por exemplo. Aspas duplas podem ser usadas para encontrar duas palavras em sequência, de modo que a pesquisa <em>"meu amor"</em> encontre registros que contenham as duas palavras juntas, mas não encontre registros com o texto <em>''meu primeiro amor''</em>.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<ul><li>Cadastrar Novo Cartão: utilize para cadastrar apenas um cartão de acesso;</li><li>Cadastrar Sequência de Cartões: utilize para cadastrar mais de um cartão de acesso, em sequência. Utilize o campo "Pré visualização" para verificar como serão as numerações dos cartões incluídos.</li></ul>
<p>Ao acessar essa rotina, o Biblivre listará automaticamente todos os Cartões de Acesso previamente cadastrados.  Você poderá então filtrar essa lista, digitando o <em>Código</em> de um Cartão de Acesso que queira encontrar.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>A pesquisa buscará cada um dos termos digitados nos campos <em>Requerente, Autor ou Título</em>.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p><strong>Atenção:</strong> Este relatório pode levar alguns minutos para ser gerado, dependendo do tamanho da base bibliográfica.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>Antes de cadastrar um usuário é recomendado verificar se ele já está cadastrado, através da <strong>pesquisa simplificada</strong>, que buscará cada um dos termos digitados no campo selecionado ou através da <strong>pesquisa avançada</strong>, que confere um maior controle sobre os usuários localizados, permitindo, por exemplo, buscar usuários com multas pendentes.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>Ao acessar essa rotina, o Biblivre listará automaticamente todos os Tipos de Usuários previamente cadastrados.  Você poderá então filtrar essa lista, digitando o <em>Nome</em> de um Tipo de Usuário que queira encontrar.</p>', '2014-06-14 19:34:08.805257', 1, '2014-06-14 19:34:08.805257', 1, false);
<p>Antes de registrar un usuario es recomendable verificar si el ya está registrado, a través de la <strong>búsqueda simplificada</strong>, que buscará cada uno de los términos digitados en el campo seleccionado o a través de la <strong>búsqueda avanzada</strong>, que otorga un mayor control sobre los Usuarios localizados, permitiendo, por ejemplo, buscar Usuarios con multas pendientes.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p>Al accesar a esa rutina, el Biblivre listará automáticamente todos los Tipos de Usuarios previamente registrados. Usted podrá entonces filtrar esa lista, digitando el <em>Nombre</em> de un Tipo de Usuario que quiera encontrar.</p>', '2014-07-19 11:28:46.69376', 1, '2014-07-19 11:28:46.69376', 1, false);
<p><strong>Attention: this module performs advanced configurations in Biblivre 4, and needs to be used solely by advanced Users, experienced in IT.</strong>.</p>
<p>To add a new language, please download the Portuguese language file, do the translation of the texts and then send the file. Remember that only the <strong>texts</strong> (after the = sign) must be translated. Do not modify the keys; if you do so, Biblivre 4 will not be able to find the text </p>
<p>Example: let´s imagine that you wish to modify the text in the main menu of <i>Search</i> to <i>Look for</i>. You will then have to download the language file and modify the following line:</p>
<p><strong>*menu.search</strong> = Search</p>
<p>To:</p>
<p><strong>*menu.search</strong> = Loo for</p>
<p>And then deliver the language file. Biblivre 4 will process the file and will modify the menu text.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>The search will search Biblivre registered users and will work in the same manner of the User Registration Simple search routine.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
.', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>When the reader is leaving, you will be able to unbind the card looking for its code </p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>In order to conduct a search please fill in the terms of the search, selecting your field of interest. Right afterwards, select one or more libraries where the records can be traced.. <span class="warn">Attention: select just a few libraries in order to prevent the Distributed Search from running too slowly, as this depends on the communication between libraries and on the size of each collection.</span></p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>Cancellations can be made selecting the reader with the reservation.</p><p>The duration of the reserve is calculated according to the User Type, configured by the <strong>Administration</strong> menu and defined during the reader´s registration.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>Labels for one or more titles can be created in a single printing, using the search below. Please remember the details, as the result of this search is a list of copies (units) and not of bibliographic records.</p>
<p> After finding the copy(ies) you are interested in, use the button <strong>"Select copy (or unit) "</strong> to add it to the list of labels to be printed. You may carry out several searches, without losing the previous selection. When you are finally satisfied with the selection, press the button <strong>"Print labels "</strong>. You may choose which model of the labels page you will use and the initial position.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>The simplest way is using the <strong>Simple search </strong>, that will search each one of the terms typed in the following fields: <em>{0}</em>.</p>
<p>Terms are sought in its full form, however it is possible to use the asterisk (*) to look for incomplete terms, so that the serarch in <em>''brasil*''</em> may find, for example, records containing <em>''brasil''</em>, <em>''brasilia''</em> and in <em>''brasileiro''</em>. Double quotation marks can be used to find terms in sequence, so that search  <em>"my love"</em> may find records containing the two terms together, but shall not find records such as  in the text <em>''my first love''</em>.</p>
<p>The <strong>advanced search</strong> provides a higher control on the records traced, allowing, for example, searches by cataloging date or exactly in the desired field.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>Search will look for each one of the terms typed in the following fields: <em>{0}</em>.</p>
<p> Terms are sought in its full form, however it is possible to use the asterisk (*) to look for incomplete terms, so that the search in <em>''brasil*''</em> may find records containing, for example, <em>''brasil''</em>, <em>''brasilia''</em> and in <em>''brasileiro''</em>. Double quotation marks can be used to find terms in sequence, so that search  <em>"my love"</em> may find records containing the two terms together, but shall not find records such as  in the text <em>''my first love''</em>.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p> Each search will look for each of the terms entered in the fields<em>Number of Order Registration, Fancy Name of Supplier and Author or Title of Request</em>.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>Search will look for every single term inserted in fields <em>Quotation Registration Number or Supplier Fancy Name </em>.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>Welcome to the <strong>Free Library (Biblivre) version 4.0</strong>.</p>
<p>You may conduct searches by Bibliographic Records, Authorities and Vocabulary through the option <em>"Search"</em> in the upper menu. This is the same <em>"Search"</em> that readers may use when accessing <strong>Biblivre</strong>, without the need of username and password when searching for records in the Main Base.</p>
<p>In order to register readers, make loans, returns and reservations, and also to control access to the library and print user cards, please use the option <em>"Circulation"</em>, also in the upper menu.</p>
<p>In the option <em>"Cataloging"</em>, you will be able to control the collections of the library, and to catalog Works and copies, and also carry out controls on Authorities and Vocabulary. Also through this option you can print labels used in copies or units, and move records among databases (Main, Work, Private and Recycle Bin), import and export records and add digital files to the existing records.</p>
<p> <strong>Biblivre</strong> also has a control system for the acquisition process, in order to assist in the purchase and reception of publication, through the option <em>"Acquisition"</em>.</p>
<p>In <em>"Administration"</em>, you will be able to change access passwords, configure <strong>Biblivre</strong> resources, such as forms fields, translations and user types, register access cards, create reports and conduct maintenance services in the database, which include the generation of backups and the reindexing of the database, which must be used when some records cannot be found in the searches.</p>
<p>Should you need additional information on  <strong>Biblivre</strong>, please go to the option <em>"Help"</em> and read the Manual of the program or the FAQs, in <a href="http://biblivre.org.br/forum" target="_blank">Forum</a>.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>It is a program involving cataloging and the dissemination of collections from public and private libraries, of varied sizes, in addition to promoting the circulation and sharing of information content, such as texts, music, images and films or any other kind of digital object.</p>
<p>Today <strong>Biblivre</strong> is successful throughout Brazil as well as abroad and, in view of its high cultural importance, it is consolidating as the preferential application for the digital inclusion of citizens.</p>
<p>If you wish to search the catalogue and have access to the digital works available, please use the option <em>"Search"</em> in the upper menu. No username or password is required.</p>
<p>For other services, such as circulation, cataloging, acquisition and administration, you will need a <strong>username</strong> and <strong>password</strong>.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>When accessing this routine, Biblivre will automatically list all the Servers previously registered. You may then filter the list, inserting the <em>Name</em> of a Server you may wish to find.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>The search will look for one of the terms inserted in the following fields: <em>{0}</em>.</p>
<p>Terms are searched in its full format, however it is possible to use the asterisk (*) to look for incomplete terms, so that the search <em>''brasil*''</em> may find records containing, for example <em>''brasil''</em>, <em>''brasilia''</em> and <em>brasileiro</em>. Double quotation marks can be used to find two terms in sequence, so that the search <em>"my love"</em> may find records containing the two terms together, but it will not find records such as  in the text <em>''my first love''</em>.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>Search will look for each one of the terms inserted in the fields <em>Requester, author or Title </em>.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p><strong>Attention:</strong> Issuance of this report may take some minutes, depending on the size of the bibliographic base.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>Before registering a user it is recommended to check whether he/she is already registered, through a <strong>Simple search</strong>, which will search each of the terms inserted in the selected field or through an <strong>Advanced research </strong>, which provides a better control on users found, allowing, for example, searching users with pending fines.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>When accessing this routine, Biblivre will automatically list all the types of Users previously registered. You will be able to filter that list, inserting the <em>Name</em> of a Type of User you wish to trace.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 10:56:18.338867', 1, false);
<p>It is possible to generate the user cards for one or more readers in a single printing, using the search below.</p>
<p>After finding the reader(s), use the button <strong>"Select user "</strong> to add them to the User Cards printing list. You can do several searches, without missing the previous selection. Once you are satisfied with the selection, press the button <strong>"print user cards "</strong>. You can select the position of the first user card in the label page.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 13:41:48.22945', 1, false);
<p>Some of the reports available have filters, such as Bibliographic Base, or Term, for example. For others, you just have to select the report and press "Generate Report" ".</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 13:41:48.22945', 1, false);
<ul><li>Register New Card: Use just one access card;</li><li>To Register Card Sequence: use more than just one access card in sequence. Use the field "pre-visualization'' to see how card will be numbered.</li></ul>
<p>When accessing this routine, Biblivre will automatically list all the Access Cards previously registered. You may then filter that list, inserting the <em>Code</em> of the Access Card you wish to find.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 13:41:48.22945', 1, false);
<p>For example, if you modify the translation of the key <strong>"menu.search"</strong> from "Search" to "Trace" through the Translations module for multi-libraries, all the libraries in this group will see the new translation. However, if one of the administrators of one of these libraries modifies, through the <strong>"Translations"</strong> module of his library, the same key to "Search", this in-house translation will have priority just for this library.</p>
<p>In order to add a new language, you will have to download the language file in Portuguese, do the translation of the texts and then upload the file. Remember that only the <strong>texts</strong> (after the = sign) must be modified.  Do not modify the keys, as otherwise the Biblivre 4 will not be able to trace the text </p>
<p>Example: Let´s say that you wish to modify the text in the main menu from <i>Search</i> to <i>Trace</i>.  You will have to download the language file and modify this line:</p>
<p><strong>*menu.search</strong> = Search</p>
<p>To:</p>
<p><strong>*menu.search</strong> = Trace</p>
<p>and then upload the language file. Biblivre 4 will process the file and will modify the menu text.</p>', '2014-07-26 10:56:18.338867', 1, '2014-07-26 13:41:48.22945', 1, false);


